import "./Footer.css";
function Footer() {
  return (
    <div className="footer_box">
      <div className="menu">
        <div className="team_name">
          <h2>Team Name</h2>
        </div>
        <div className="gisu">기수</div>
        <div className="team_member">Team Member</div>
      </div>

      <div className="information"></div>
    </div>
  );
}

export default Footer;
